	constructor(props: any){
	 super(props);
	 this.state = { 
	 	breathe: "BREATE IN"
	 };
	}

	render() {

	return(
	<div className="container">
     <div className="audio_div">
     	<div className="head">
       <strong>{this.state.breathe}</strong>
       </div>
       <br/>
       <div className="animation">
       </div>
       <div className="audio_control">
        <audio ref="audio_tag" src={"/assets/sounds/audio_file.mpeg"} controls autoPlay loop />
        </div>
     </div>
    </div>
	);

	}
}
